// Contact.js
import React from 'react';

const Contact = () => {
    return (
        <section id="contact" className="py-20">
            <div className="container mx-auto px-4">
                <h2 className="text-3xl font-bold text-center">Contact</h2>
                <form className="mt-8 max-w-lg mx-auto bg-white p-8 rounded shadow-md">
                    <div className="mb-4">
                        <label className="block text-gray-700" htmlFor="name">Name</label>
                        <input className="w-full px-4 py-2 mt-2 border rounded" type="text" id="name" placeholder="Your Name" />
                    </div>
                    <div className="mb-4">
                        <label className="block text-gray-700" htmlFor="email">Email</label>
                        <input className="w-full px-4 py-2 mt-2 border rounded" type="email" id="email" placeholder="Your Email" />
                    </div>
                    <div className="mb-4">
                        <label className="block text-gray-700" htmlFor="message">Message</label>
                        <textarea className="w-full px-4 py-2 mt-2 border rounded" id="message" rows="4" placeholder="Your Message"></textarea>
                    </div>
                    <button className="w-full bg-blue-500 text-white py-2 px-4 rounded hover:bg-blue-700" type="submit">Send Message</button>
                </form>
            </div>
        </section>
    );
};

export default Contact;
